import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import HomePage from "./pages/HomePage";
import MenuPage from "./pages/MenuPage";
import CartPage from "./pages/CartPage";
import OrdersPage from "./pages/OrdersPage";


const App = () => {
  return (
    <div
    style={{
      backgroundImage: "url('images/back.jpg')",
      backgroundSize: "cover",
      backgroundRepeat: "no-repeat",
      backgroundPosition: "center",
      minHeight: "100vh",
      backgroundAttachment: "fixed"
    }}
  >

      <nav style={{ display: "flex", justifyContent: "center",  gap: "20px", padding: "10px", background: "#f3f3f3" }}>
        <Link to="/home" style={{ textDecoration: "none"}}>�������</Link>
        <Link to="/menu" style={{ textDecoration: "none"}}>����</Link>
        <Link to="/cart" style={{ textDecoration: "none"}}>�����</Link>
        <Link to="/orders" style={{ textDecoration: "none"}}>����������</Link>
      </nav>

      <Routes>

        <Route path="/home" element={<HomePage />} />
        <Route path="/menu" element={<MenuPage />} />
        <Route path="/cart" element={<CartPage />} />
        <Route path="/orders" element={<OrdersPage />} />
        <Route path="*" element={<MenuPage />} />
      </Routes>
    </div>
  );
};

export default App;
